import React, { Component } from 'react'

class Calc extends Component {
    constructor(){
        super()
        this.state={
            output:"Output will be displayed here"
        }
    }
    clear(){
        this.setState({
            output:""
        })
    }
    divide(){
        this.setState(prevState =>({
            output:prevState.output +"/"
        }))
    
    }
    // numbers
    one(){
        this.setState(prevState =>({
            output:prevState.output +"7"
        }))
    
    }
    seven(){
        this.setState(prevState =>({
            output:prevState.output +"7"
        }))
    
    }
    render() {
    return (
        <div>
            <h1>{this.state.output}</h1>
            <button onClick={()=>this.clear()}>Clear</button>
            <button onClick={()=>this.clear()}>Clear</button>
            <button onClick={()=>this.divide()}>/</button>
            <button onClick={()=>this.seven()}>7</button>
            <button onClick={()=>this.divide()}>8</button>
            <button onClick={()=>this.divide()}>9</button>
            <button onClick={()=>this.divide()}>*</button>
            <button onClick={()=>this.divide()}>4</button>
            <button onClick={()=>this.divide()}>5</button>
            <button onClick={()=>this.divide()}>6</button>
            <button onClick={()=>this.divide()}>-</button>
            <button onClick={()=>this.divide()}>1</button>
            <button onClick={()=>this.divide()}>2</button>
            <button onClick={()=>this.divide()}>3</button>
            <button onClick={()=>this.divide()}>+</button>
            <button onClick={()=>this.divide()}>0</button>
            <button onClick={()=>this.divide()}>.</button>
            <button onClick={()=>this.divide()}>-</button>
        </div>
    )
    }
}

export default Calc
